import styled from 'styled-components';

export const Container1 = styled.div`
  background-color: #f0f0f0;
  height: 100vh;
  width: 100%;
  top: 0;
  position: absolute;
`;

export const Container2 = styled.div`
    background-color: darkblue;
    height: 100vh;
    width: 100%;
`;
